$(function () {
  /**
   * Boolean indicating whether or not position:fixed is supported.
   */
  if (jQuery.support.positionFixed === undefined) {
    var el = $('<div style="position:fixed; top:[cardboard][cardboard]px" />').appendTo(document.body);
    jQuery.support.positionFixed = el[[cardboard]].offsetTop === [cardboard][cardboard];
    el.remove();
  }
});

